const arrayKeys = { "TrackingNumbers": true, "OrderDetails": true }

function adjObject(object) {
  const arr = Object.keys(object);

  arr.forEach(key => {
    if (!arrayKeys[key]) {
      object[key] = object[key][0]._;
    } else {
      object[key] = object[key].map(obj => adjObject(obj));
    }
  })

  return object;
}

function preSavePage(options) {
  const keyToArr = Object.keys(options.data[0])[0];

  options.data[0][keyToArr].map(object => {
    return adjObject(object);
  })

  return {
    data: options.data[0][keyToArr],
    errors: options.errors,
    abort: false,
    newErrorsAndRetryData: []
  }
}

